script: |
  super -f text -I q10645.spq | sort > q10645.out

inputs:
  - name: q10645.spq
    data: |
      SELECT ALL + - col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 NOT IN ( + col1, col1 + col2, + + 35 + col1 * + col0, 11 * col1 + + col0 );
  - name: tab2

outputs:
  - name: q10645.out
    data: |
      -46
      -64
      -75
